Royalties are payments made by a business for the right to use any long-term assets for gain. Assets for which royalties are often charged include intellectual property and minerals.

Includes:
* payments made under licensing arrangements;
* royalties paid for patents and copyrights;
* royalties paid for timber and quarrying; and
* royalties paid for the sub-leasing of land for mineral leases.
